Hey Folks,<p>I&#x27;m building an open source project called &quot;ChatGPT Arms&quot;, the goal is to provide standard interface&#x2F;system for integrating chatGPT with the real world (API&#x27;s and other systems).<p>I&#x27;m just getting rolling on it, and I&#x27;m already impressed out how useful it is.<p>GitHub: https:&#x2F;&#x2F;github.com&#x2F;TaylorHawkes&#x2F;ChatGPTArmsAnd 
Demo: http:&#x2F;&#x2F;chatgptarms.com&#x2F;
Video:https:&#x2F;&#x2F;www.youtube.com&#x2F;watch?v=o2LiPkkIjeQ<p>If any one is interested in helping built out the core or any &quot;Arms&quot; (npm packages), feel free to jump on the discord or fork the repo.
